import React from "react";
import { Link } from "react-router-dom";
import { Typography } from "@material-ui/core";
import Roulette from "../images/roulette.svg";
const Landing = () => {
  return (
    <div>
      <div>
        <Typography>Roulette</Typography>
        <Roulette />
      </div>
    </div>
  );
};

export default Landing;
